import React from 'react';
import {Form,Button,Col} from "react-bootstrap";

export default function Details() {
    return (
        <Form>
            <Form.Row>
                <Col>
                <Form.Label column sm="2">
                    First name
                </Form.Label>
                <Form.Control placeholder="First name" sm="4" />
                </Col>
                <Col>
                <Form.Control placeholder="Last name" />
                </Col>
            </Form.Row>
        </Form>
    )
}
